00022     public static void ParseIdentifierToken(CSharpParserModel model)
00023     {
00024         var originalTokenIndex = model.TokenWalker.Index;
00025         
00026         model.TryParseExpressionSyntaxKindList.Add(SyntaxKind.TypeClauseNode);
00027         model.TryParseExpressionSyntaxKindList.Add(SyntaxKind.VariableDeclarationNode);
00028         model.TryParseExpressionSyntaxKindList.Add(SyntaxKind.VariableReferenceNode);
00029         model.TryParseExpressionSyntaxKindList.Add(SyntaxKind.ConstructorInvocationExpressionNode);
00030         
00031         if (model.CurrentCodeBlockBuilder.CodeBlockOwner is not null &&
00032             model.CurrentCodeBlockBuilder.CodeBlockOwner.SyntaxKind != SyntaxKind.TypeDefinitionNode)
00033         {
00034             // There is a syntax conflict between a ConstructorDefinitionNode and a FunctionInvocationNode.
00035             //
00036             // Disambiguation is done based on the 'CodeBlockOwner' until a better solution is found.
00037             //
00038             // If the supposed "ConstructorDefinitionNode" does not have the same name as
00039             // the CodeBlockOwner.
00040             //
00041             // Then, it perhaps should be treated as a function invocation (or function definition).
00042             // The main case for this being someone typing out pseudo code within a CodeBlockOwner
00043             // that is a TypeDefinitionNode.
00044             model.TryParseExpressionSyntaxKindList.Add(SyntaxKind.FunctionInvocationNode);
00045         }
00046         
00047         var successParse = ParseOthers.TryParseExpression(null, model, out var expressionNode);
00048         
00049         if (!successParse)
00050         {
00051             expressionNode = ParseOthers.ParseExpression(model);
00052             model.StatementBuilder.ChildList.Add(expressionNode);
00053             return;
00054         }
00055         
00056         switch (expressionNode.SyntaxKind)
00057         {
00058             case SyntaxKind.TypeClauseNode:
00059                 MoveToHandleTypeClauseNode(originalTokenIndex, (TypeClauseNode)expressionNode, model);
00060                 return;
00061             case SyntaxKind.VariableDeclarationNode:
00062                 if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenParenthesisToken ||
00063                     model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenAngleBracketToken)
00064                 {
00065                     MoveToHandleFunctionDefinition((VariableDeclarationNode)expressionNode, model);
00066                     return;
00067                 }
00068                 
00069                 MoveToHandleVariableDeclarationNode((VariableDeclarationNode)expressionNode, model);
00070                 return;
00071             case SyntaxKind.VariableReferenceNode:
00072             case SyntaxKind.FunctionInvocationNode:
00073             case SyntaxKind.ConstructorInvocationExpressionNode:
00074                 model.StatementBuilder.ChildList.Add(expressionNode);
00075                 return;
00076             default:
00077                 model.DiagnosticBag.ReportTodoException(model.TokenWalker.Current.TextSpan, $"nameof(ParseIdentifierToken) default case");
00078                 return;
00079         }
00080     }
