00091     public static void MoveToHandleVariableDeclarationNode(IVariableDeclarationNode variableDeclarationNode, IParserModel model)
00092     {
00093         var variableKind = VariableKind.Local;
00094                 
00095         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken ||
00096             (model.TokenWalker.Current.SyntaxKind == SyntaxKind.EqualsToken &&
00097                  model.TokenWalker.Next.SyntaxKind == SyntaxKind.CloseAngleBracketToken))
00098         {
00099             variableKind = VariableKind.Property;
00100         }
00101         else if (model.CurrentCodeBlockBuilder.CodeBlockOwner is not null &&
00102                  model.CurrentCodeBlockBuilder.CodeBlockOwner.SyntaxKind == SyntaxKind.TypeDefinitionNode)
00103         {
00104             variableKind = VariableKind.Field;
00105         }
00106         
00107         ((VariableDeclarationNode)variableDeclarationNode).VariableKind = variableKind;
00108         
00109         model.Binder.BindVariableDeclarationNode(variableDeclarationNode, model);
00110         model.CurrentCodeBlockBuilder.ChildList.Add(variableDeclarationNode);
00111         model.StatementBuilder.ChildList.Add(variableDeclarationNode);
00112         
00113         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken)
00114         {
00115             ParsePropertyDefinition((CSharpParserModel)model);
00116         }
00117         else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.EqualsToken &&
00118                  model.TokenWalker.Next.SyntaxKind == SyntaxKind.CloseAngleBracketToken)
00119         {
00120             ParsePropertyDefinition_ExpressionBound((CSharpParserModel)model);
00121         }
00122     }
