00124     public static void MoveToHandleTypeClauseNode(int originalTokenIndex, TypeClauseNode typeClauseNode, IParserModel model)
00125     {
00126         if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.StatementDelimiterToken ||
00127             model.TokenWalker.Current.SyntaxKind == SyntaxKind.EndOfFileToken ||
00128             model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken ||
00129             model.TokenWalker.Current.SyntaxKind == SyntaxKind.CloseBraceToken)
00130         {
00131             model.StatementBuilder.ChildList.Add(typeClauseNode);
00132         }
00133         else if (model.CurrentCodeBlockBuilder.CodeBlockOwner is TypeDefinitionNode typeDefinitionNode &&
00134                  UtilityApi.IsConvertibleToIdentifierToken(typeClauseNode.TypeIdentifierToken.SyntaxKind) &&
00135                  model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenParenthesisToken &&
00136                  typeDefinitionNode.TypeIdentifierToken.TextSpan.GetText() == typeClauseNode.TypeIdentifierToken.TextSpan.GetText())
00137         {
00138             // ConstructorDefinitionNode
00139             
00140             var identifierToken = UtilityApi.ConvertToIdentifierToken(typeClauseNode.TypeIdentifierToken, model);
00141             
00142             ParseFunctions.HandleConstructorDefinition(
00143                 typeDefinitionNode,
00144                 identifierToken,
00145                 (CSharpParserModel)model);
00146         }
00147         else
00148         {
00149             model.StatementBuilder.ChildList.Add(typeClauseNode);
00150         }
00151         
00152         return;
00153     }
