00155     public static void ParsePropertyDefinition(CSharpParserModel model)
00156     {
00157         #if DEBUG
00158         model.TokenWalker.SuppressProtectedSyntaxKindConsumption = true;
00159         #endif
00160         
00161         var openBraceToken = (OpenBraceToken)model.TokenWalker.Consume();
00162         
00163         var openBraceCounter = 1;
00164         
00165         while (true)
00166         {
00167             if (model.TokenWalker.IsEof)
00168                 break;
00169 
00170             if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenBraceToken)
00171             {
00172                 ++openBraceCounter;
00173             }
00174             else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CloseBraceToken)
00175             {
00176                 if (--openBraceCounter <= 0)
00177                     break;
00178             }
00179 
00180             _ = model.TokenWalker.Consume();
00181         }
00182 
00183         var closeTokenIndex = model.TokenWalker.Index;
00184         var closeBraceToken = (CloseBraceToken)model.TokenWalker.Match(SyntaxKind.CloseBraceToken);
00185         
00186         #if DEBUG
00187         model.TokenWalker.SuppressProtectedSyntaxKindConsumption = false;
00188         #endif
00189     }
