00200     public static void ParseColonToken(CSharpParserModel model)
00201     {
00202         var colonToken = (ColonToken)model.TokenWalker.Consume();
00203     
00204         if (model.SyntaxStack.TryPeek(out var syntax) && syntax.SyntaxKind == SyntaxKind.TypeDefinitionNode)
00205         {
00206             var typeDefinitionNode = (TypeDefinitionNode)model.SyntaxStack.Pop();
00207             var inheritedTypeClauseNode = model.TokenWalker.MatchTypeClauseNode(model);
00208 
00209             model.Binder.BindTypeClauseNode(inheritedTypeClauseNode, model);
00210 
00211             typeDefinitionNode.SetInheritedTypeClauseNode(inheritedTypeClauseNode);
00212 
00213             model.SyntaxStack.Push(typeDefinitionNode);
00214             model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = typeDefinitionNode;
00215         }
00216         else
00217         {
00218             model.DiagnosticBag.ReportTodoException(colonToken.TextSpan, "Colon is in unexpected place.");
00219         }
00220     }
