00226     public static void ParseOpenBraceToken(OpenBraceToken openBraceToken, CSharpParserModel model)
00227     {    
00228         if (model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner is null)
00229         {
00230             var arbitraryCodeBlockNode = new ArbitraryCodeBlockNode(model.CurrentCodeBlockBuilder.CodeBlockOwner);
00231             model.SyntaxStack.Push(arbitraryCodeBlockNode);
00232             model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = arbitraryCodeBlockNode;
00233         }
00234         
00235         model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner.SetOpenBraceToken(openBraceToken, model);
00236 
00237         var parentScopeDirection = model.CurrentCodeBlockBuilder?.CodeBlockOwner?.ScopeDirectionKind ?? ScopeDirectionKind.Both;
00238         if (parentScopeDirection == ScopeDirectionKind.Both)
00239         {
00240             if (!model.CurrentCodeBlockBuilder.PermitInnerPendingCodeBlockOwnerToBeParsed)
00241             {
00242                 model.TokenWalker.DeferParsingOfChildScope(openBraceToken, model);
00243                 return;
00244             }
00245 
00246             model.CurrentCodeBlockBuilder.PermitInnerPendingCodeBlockOwnerToBeParsed = false;
00247         }
00248 
00249         var nextCodeBlockOwner = model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner;
00250         var nextReturnTypeClauseNode = nextCodeBlockOwner.GetReturnTypeClauseNode();
00251 
00252         model.Binder.OpenScope(nextCodeBlockOwner, nextReturnTypeClauseNode, openBraceToken.TextSpan, model);
00253         model.CurrentCodeBlockBuilder = new(parent: model.CurrentCodeBlockBuilder, codeBlockOwner: nextCodeBlockOwner);
00254         nextCodeBlockOwner.OnBoundScopeCreatedAndSetAsCurrent(model);
00255     }
