00261     public static void ParseCloseBraceToken(CloseBraceToken closeBraceToken, CSharpParserModel model)
00262     {
00263         if (model.CurrentCodeBlockBuilder.ParseChildScopeQueue.TryDequeue(out var deferredChildScope))
00264         {
00265             deferredChildScope.PrepareMainParserLoop(model.TokenWalker.Index - 1, model);
00266             return;
00267         }
00268 
00269         if (model.CurrentCodeBlockBuilder.CodeBlockOwner is not null)
00270             model.CurrentCodeBlockBuilder.CodeBlockOwner.SetCloseBraceToken(closeBraceToken, model);
00271         
00272         model.Binder.CloseScope(closeBraceToken.TextSpan, model);
00273     }
