00298     public static void ParseOpenSquareBracketToken(CSharpParserModel model)
00299     {
00300         var openSquareBracketToken = (OpenSquareBracketToken)model.TokenWalker.Consume();
00301     
00302         if (model.StatementBuilder.ChildList.Count != 0)
00303         {
00304             model.DiagnosticBag.ReportTodoException(
00305                 openSquareBracketToken.TextSpan,
00306                 $"Unexpected '{nameof(OpenSquareBracketToken)}'");
00307             return;
00308         }
00309         var openSquareBracketCounter = 1;
00310         var corruptState = false;
00311         
00312         #if DEBUG
00313         model.TokenWalker.SuppressProtectedSyntaxKindConsumption = true;
00314         #endif
00315         
00316         while (!model.TokenWalker.IsEof)
00317         {
00318             if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.OpenSquareBracketToken)
00319             {
00320                 ++openSquareBracketCounter;
00321             }
00322             else if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CloseSquareBracketToken)
00323             {
00324                 if (--openSquareBracketCounter <= 0)
00325                     break;
00326             }
00327             else if (!corruptState)
00328             {
00329                 var tokenIndexOriginal = model.TokenWalker.Index;
00330                 
00331                 model.ExpressionList.Add((SyntaxKind.CloseSquareBracketToken, null));
00332                 model.ExpressionList.Add((SyntaxKind.CommaToken, null));
00333                 var expression = ParseOthers.ParseExpression(model);
00334                 
00335                 if (model.TokenWalker.Current.SyntaxKind == SyntaxKind.CommaToken)
00336                     _ = model.TokenWalker.Consume();
00337                     
00338                 if (tokenIndexOriginal < model.TokenWalker.Index)
00339                     continue; // Already consumed so avoid the one at the end of the while loop
00340             }
00341 
00342             _ = model.TokenWalker.Consume();
00343         }
00344 
00345         var closeTokenIndex = model.TokenWalker.Index;
00346         var closeSquareBracketToken = (CloseSquareBracketToken)model.TokenWalker.Match(SyntaxKind.CloseSquareBracketToken);
00347         
00348         #if DEBUG
00349         model.TokenWalker.SuppressProtectedSyntaxKindConsumption = false;
00350         #endif
00351     }
