00359     public static void ParseEqualsToken(CSharpParserModel model)
00360     {
00361         if (model.StatementBuilder.ChildList.Count == 0)
00362         {
00363             ParseOthers.StartStatement_Expression(model);
00364             return;
00365         }
00366         
00367         if (model.StatementBuilder.TryPeek(out var syntax) &&
00368             syntax.SyntaxKind == SyntaxKind.VariableDeclarationNode)
00369         {
00370             var variableDeclarationNode = (VariableDeclarationNode)syntax;
00371             
00372             model.TokenWalker.Backtrack();
00373             var expression = ParseOthers.ParseExpression(model);
00374             
00375             if (expression.SyntaxKind != SyntaxKind.VariableAssignmentExpressionNode)
00376             {
00377                 // TODO: Report a diagnostic
00378                 return;
00379             }
00380             
00381             model.StatementBuilder.ChildList.Add(expression);
00382         }
00383     }
