00395     public static void ParseStatementDelimiterToken(StatementDelimiterToken statementDelimiterToken, CSharpParserModel model)
00396     {
00397         if (model.SyntaxStack.TryPeek(out var syntax) && syntax.SyntaxKind == SyntaxKind.NamespaceStatementNode)
00398         {
00399             var closureCurrentCompilationUnitBuilder = model.CurrentCodeBlockBuilder;
00400             ICodeBlockOwner? nextCodeBlockOwner = null;
00401             TypeClauseNode? scopeReturnTypeClauseNode = null;
00402 
00403             var namespaceStatementNode = (NamespaceStatementNode)model.SyntaxStack.Pop();
00404             nextCodeBlockOwner = namespaceStatementNode;
00405             
00406             namespaceStatementNode.SetStatementDelimiterToken(statementDelimiterToken, model);
00407 
00408             model.Binder.OpenScope(
00409                 nextCodeBlockOwner,
00410                 scopeReturnTypeClauseNode,
00411                 statementDelimiterToken.TextSpan,
00412                 model);
00413 
00414             model.Binder.AddNamespaceToCurrentScope(
00415                 namespaceStatementNode.IdentifierToken.TextSpan.GetText(),
00416                 model);
00417 
00418             model.CurrentCodeBlockBuilder = new(model.CurrentCodeBlockBuilder, nextCodeBlockOwner);
00419         }
00420         else if (model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner is not null &&
00421                  !model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner.OpenBraceToken.ConstructorWasInvoked)
00422         {
00423             var pendingChild = model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner;
00424         
00425             model.Binder.OpenScope(pendingChild, CSharpFacts.Types.Void.ToTypeClause(), statementDelimiterToken.TextSpan, model);
00426             model.CurrentCodeBlockBuilder = new(model.CurrentCodeBlockBuilder, pendingChild);
00427             pendingChild.OnBoundScopeCreatedAndSetAsCurrent(model);
00428             
00429             model.Binder.CloseScope(statementDelimiterToken.TextSpan, model);
00430     
00431             if (model.CurrentCodeBlockBuilder.Parent is not null)
00432                 model.CurrentCodeBlockBuilder = model.CurrentCodeBlockBuilder.Parent;
00433                 
00434             model.CurrentCodeBlockBuilder.InnerPendingCodeBlockOwner = null;
00435         }
00436     }
