00826 /*
00827     (2024-11-08) The issue is:
00828     ==========================
00829     'int[] x = new { 1, 2, 3, };'
00830     'int[] MyMethod() { }'
00831     
00832     In my mind this was an issue, but it wouldn't be an issue because in order
00833     to get to this code I have to see an OpenParenthesisToken.
00834     
00835     The variable assignment doesn't conflict at all.
00836     
00837     But:
00838     'int[] x = new { 1, 2, 3, };'
00839     'int[2] = 7;'
00840     
00841     At the start of a statement, there can be a conflict here,
00842     but given the situation, one can see the second line has a '2' in the array's square brackets
00843     so therefore you know the second line is a variable assignment expression.
00844     (the first line is a variable declaration statement / variable assignment expression).
00845 
00846     https://learn.microsoft.com/en-us/dotnet/csharp/language-reference/builtin-types/arrays
00847     =======================================================================================
00848         // Declare a single-dimensional array of 5 integers.
00849         int[] array1 = new int[5];
00850         
00851         // Declare and set array element values.
00852         int[] array2 = [1, 2, 3, 4, 5, 6];
00853         
00854         // Declare a two dimensional array.
00855         int[,] multiDimensionalArray1 = new int[2, 3];
00856         
00857         // Declare and set array element values.
00858         int[,] multiDimensionalArray2 = { { 1, 2, 3 }, { 4, 5, 6 } };
00859         
00860         // Declare a jagged array.
00861         int[][] jaggedArray = new int[6][];
00862         
00863         // Set the values of the first array in the jagged array structure.
00864         jaggedArray[0] = [1, 2, 3, 4];
00865     ---------------------------------------------------------------------------------------
00866     
00867     None of the array declaration examples contain a number inside the
00868     array square brackets at the start of the statement.
00869     
00870     When dealing with a function definition,
00871     the TypeClauseNode for its return type might be an array.
00872     
00873     So I have to properly make sense of the 'int[]'
00874     if I have 'int[] MyMethod() { }'.
00875     
00876     But, I just saw that it seems I can check inside the array brackets
00877     whether there is a number or not.
00878     
00879     And there being a number means that it is an expression of some sort,
00880     whereas the lack or one means it is a statement of some sort.
00881     
00882     In the case of:
00883     'Person MyMethod() { }'
00884     
00885     When I read 'Person', is there any ambiguity as to whether it is
00886         - TypeClauseNode
00887         - IdentifierToken
00888     
00889     I think the question is:
00890     "At what points do I convert a token that can be a 'TypeClauseNode' to a 'TypeClauseNode'?"
00891     
00892     If the 'TypeClauseNode' is an array, then the array square brackets will not
00893     contain a number, and this is the sign that it is a 'TypeClauseNode'.
00894     
00895     If the 'TypeClauseNode' is just an IdentifierToken, where could things go from there?
00896     
00897     ConstructorDefinitionNode can occur from the following:
00898         - IdentifierToken, OpenParenthesisToken
00899     
00900     FunctionDefinitionNode can occur from the following:
00901         - TypeClauseNode, IdentifierToken, OpenParenthesisToken
00902             - This occurs when the first token initially was a 'IdentifierToken' but was not ambiguous and therefore
00903                 immediately interpreted as a 'TypeClauseNode' rather than as an 'IdentifierToken'.
00904         - IdentifierToken, IdentifierToken, OpenParenthesisToken
00905         
00906     VariableDeclarationNode can occur from the following:
00907         - TypeClauseNode, IdentifierToken, EqualsToken
00908         
00909     TypeDefinitionNode can occur from the following:
00910         - SyntaxKind.ClassTokenKeyword, IdentifierToken
00911     
00912     TypeDefinitionNode can occur from the following:
